const serviceData = [
  {
    id: 1,
    title: "City Transfer",
    icon: "ri-map-pin-2-line",
    desc: "This Package only Available for maximum 4 person to transfer one city to another city within 500km",
  },
 
  {
    id: 2,
    title: "Whole  City Tour",
    icon: "ri-community-line",
    desc: "It's a package of giving 4-8 person a whole day whole city tour experience",
  },

  {
    id: 3,
    title: "Unlimited Miles Car Rental",
    icon: "ri-roadster-line",
    desc: "This Package includes Unlimited Miles Car Rental for whole day",
  },

  {
    id: 4,
    title: "Fast & Easy Booking",
    icon: "ri-timer-flash-line",
    desc: "If it's so emergency this package will save your valuable time this service is fast for emergency and easy to book",
  },

  {
    id: 5,
    title: "Many Pickup Locations",
    icon: "ri-map-pin-line",
    desc: "If you have too many pickup locations then this package will be the most convenient for you",
  },

  {
    id: 6,
    title: "Airport Transfer",
    icon: "ri-flight-takeoff-line",
    desc: "Going out for Holidays or leaving country? looking for car to transfer you at Airport? we'll transfer you at airport in time!",
  },
];

export default serviceData;
